import React, { Component } from "react";
import News from "../News/News";
import { Consumer } from "../../context";

export default class HoWorldPageme extends Component {
  render() {
    <Consumer>
      {(value) => {
        console.log(value.changeTab);
        return (
          <React.Fragment>
            <News />
          </React.Fragment>
        );
      }}
    </Consumer>;
  }
}
